UPDATE `npc_text` SET `text0_0`='Looking to take a ride on a gryphon, now are ye?  Gryth Thurden is the one ye\'ll want to be seeing about that.  $B$BYe can find him on the eastern side of The Great Forge in the middle of Ironforge.',`text0_1`='Looking to take a ride on a gryphon, now are ye?  Gryth Thurden is the one ye\'ll want to be seeing about that.  $B$BYe can find him on the eastern side of The Great Forge in the middle of Ironforge.',`em0_0`=0,`em0_1`=1,`text1_0`='Ah, nothing quite like a ride on a gryphon, is there?  The night elves can keep those hippo\'s of theirs, just give me a gryphon and the wind in me hair!  $B$BWell now, I won\'t keep ye any longer, just head over to Gryth Thurden on the east side of The Great Forge and he\'ll get ye on yer way.',`text1_1`='Ah, nothing quite like a ride on a gryphon, is there?  The night elves can keep those hippo\'s of theirs, just give me a gryphon and the wind in me hair!  $B$BWell now, I won\'t keep ye any longer, just head over to Gryth Thurden on the east side of The Great Forge and he\'ll get ye on yer way.',`em1_0`=0,`em1_1`=1 WHERE `ID`=2762;
